import Router from '@/router.js'
import { apiService } from './services/api.js'

export default {
  data() {
    return {
      user: null,
    }
  },
  methods:{
    register() {
      Router.push({ path: '/register'})
    },
    login() {
      Router.push({ path: '/login'})
    },
    logout() {
      apiService.logout().then((res) => {
        this.user = null;
        Router.push({ path: '/login' })
      })
    },
    getAuth() {
      apiService.getAuth().then((res) => {
        this.user = res
      })
    }
  },
  mounted() {
    this.getAuth()
  }
}
